import React from 'react';
import { Draggable } from 'react-dnd';

const Subject = (props) => {
  const subjects = props.subject;

  return (
    <div>
      <div className="subList">
        {subjects.map((subject, index) => (
          <Draggable key={index} subject={subject}>
            <div className="subName">{subject}</div>
          </Draggable>
        ))}
      </div>
    </div>
  );
};

export default Subject;
